(1, 1, 'exp_actions_json_data', '{{exp:query sql=\"SELECT action_id, method FROM exp_actions WHERE csrf_exempt = 1\"}\"{method}\": {action_id}, {/exp:query}}', 1519659324),
(3, 1, 'member_profile_json_data', '{exp:member:custom_profile_data}{\"userid\":\"{member_id}\", \"elan_user_id\":\"{elan_user_id}\", \"screenname\": \"{screen_name}\", \"firstname\": \"{first_name}\", \"lastname\": \"{last_name}\", \"email\": \"{logged_in_email}\"}{/exp:member:custom_profile_data}\r\n', 1519659324),
(4, 1, 'journeys_json_data', '{\"mlapprentice\":{\"name\": \"ML APPRENTICE\", \"elan_map_object_id\": 64, \"first_unlock_object_id\": 117},\"mlambassador\":{\"name\": \"ML AMBASSADOR\", \"elan_map_object_id\": 1243, \"first_unlock_object_id\": 1248},\"eu\":{\"name\":\r\n\"EU Testing \", \"elan_map_object_id\": 3425, \"first_unlock_object_id\": 3425},\"asia\":{\"name\": \"Asia\", \"elan_map_object_id\": 3425, \"first_unlock_object_id\": 3425}}', 1519662560),
(5, 1, 'mlambssador_json_data', '[{exp:query sql=\"SELECT A.cat_id, A.cat_url_title, A.cat_name, IFNULL(B.cat_id, 0) AS parent_id, IFNULL(B.cat_url_title, \'\') AS parent_url_title, IFNULL(B.cat_name, \'\') AS parent_name, \'\' AS unlockorder, \'\' AS color, \'\' AS number_of_stops, \'\' AS minutes_to_finish\r\nFROM exp_categories AS A\r\nLEFT JOIN exp_categories AS B ON B.cat_id = A.parent_id\r\nJOIN exp_category_field_data AS  C ON A.cat_id = C.cat_id\r\nWHERE A.group_id = \'2\'\"}{\"cat_id\": {cat_id}, \"cat_url_title\": \"{cat_url_title}\", \"cat_name\": \"{cat_name}\", \"parent_id\": {parent_id}, \"parent_url_title\": \"{parent_url_title}\", \"parent_name\": \"{parent_name}\", \"unlockorder\": {unlockorder}, \"color\": \"{color}\", \"number_of_stops\": \"{number_of_stops}\", \"minutes_to_finish\": \"{minutes_to_finish}\"},{/exp:query}]', 1519659324),
(6, 1, 'mlapprentice_json_data', '[{exp:query sql=\"SELECT A.cat_id, A.cat_url_title, A.cat_name, IFNULL(B.cat_id, 0) AS parent_id, IFNULL(B.cat_url_title, \'\') AS parent_url_title, IFNULL(B.cat_name, \'\') AS parent_name, IFNULL(C.field_id_1, 0) AS unlockorder, IFNULL(C.field_id_2, \'\') AS color, IFNULL(C.field_id_3, \'\') AS number_of_stops, IFNULL(C.field_id_4, \'\') AS minutes_to_finish\r\nFROM exp_categories AS A\r\nLEFT JOIN exp_categories AS B ON B.cat_id = A.parent_id\r\nJOIN exp_category_field_data AS  C ON A.cat_id = C.cat_id\r\nWHERE A.group_id = \'1\'\"}{\"cat_id\": {cat_id}, \"cat_url_title\": \"{cat_url_title}\", \"cat_name\": \"{cat_name}\", \"parent_id\": {parent_id}, \"parent_url_title\": \"{parent_url_title}\", \"parent_name\": \"{parent_name}\", \"unlockorder\": {unlockorder}, \"color\": \"{color}\", \"number_of_stops\": \"{number_of_stops}\", \"minutes_to_finish\": \"{minutes_to_finish}\"},{/exp:query}]', 1519659324),
(10, 1, 'exp_categories_json_data', '{{exp:query sql=\"SELECT cat_id, cat_url_title FROM exp_categories\"}\"{cat_url_title}\": {cat_id}, {/exp:query}}', 1519659324),
(11, 1, 'mlambassador_json_data', '[{exp:query sql=\"SELECT A.cat_id, A.cat_url_title, A.cat_name, IFNULL(B.cat_id, 0) AS parent_id, IFNULL(B.cat_url_title, \'\') AS parent_url_title, IFNULL(B.cat_name, \'\') AS parent_name, \'\' AS unlockorder, \'\' AS color, \'\' AS number_of_stops, \'\' AS minutes_to_finish\r\nFROM exp_categories AS A\r\nLEFT JOIN exp_categories AS B ON B.cat_id = A.parent_id\r\nJOIN exp_category_field_data AS  C ON A.cat_id = C.cat_id\r\nWHERE A.group_id = \'2\'\"}{\"cat_id\": {cat_id}, \"cat_url_title\": \"{cat_url_title}\", \"cat_name\": \"{cat_name}\", \"parent_id\": {parent_id}, \"parent_url_title\": \"{parent_url_title}\", \"parent_name\": \"{parent_name}\", \"unlockorder\": {unlockorder}, \"color\": \"{color}\", \"number_of_stops\": \"{number_of_stops}\", \"minutes_to_finish\": \"{minutes_to_finish}\"},{/exp:query}]', 1519659324),
(12, 1, 'bugherd_js_code', '<!-- BUGHERD CODE -->', 1519659324),
(13, 1, 'modal', '<!-- template for the modal component -->\r\n<script type=\"text/x-template\" id=\"modal-template\">\r\n    <transition name=\"modal\">\r\n        <div class=\"modal-mask\">\r\n            <div class=\"modal-wrapper\">\r\n                <div class=\"modal-container\">\r\n\r\n                    <div class=\"modal-header\">\r\n                        <slot name=\"header\">\r\n                            default header\r\n                        </slot>\r\n                    </div>\r\n\r\n                    <div class=\"modal-body\">\r\n                        <slot name=\"body\">\r\n                            default body\r\n                        </slot>\r\n                    </div>\r\n\r\n                    <div class=\"modal-footer\">\r\n                        <slot name=\"footer\">\r\n                            default footer\r\n                            <button class=\"modal-default-button\" @click=\"$emit(\'close\')\">\r\n                                OK\r\n                            </button>\r\n                        </slot>\r\n                    </div>\r\n                </div>\r\n            </div>\r\n        </div>\r\n    </transition>\r\n</script>', 1519659324);
INSERT INTO `exp_specialty_templates` (`template_id`, `site_id`, `enable_template`, `template_name`, `data_title`, `template_type`, `template_subtype`, `template_data`, `template_notes`, `edit_date`, `last_author_id`) VALUES
(1, 1, 'y', 'offline_template', '', 'system', NULL, '<html>\n<head>\n<script src=\"/js/jquery-2.2.3.min.js\"></script>\n<script src=\"/js/jquery-ui.min.js\"></script>\n<title>Coach Journey</title>\n\n<style type=\"text/css\">\n\nbody {\nbackground-color:	#ffffff;\nmargin:				50px;\nfont-family:		Verdana, Arial, Tahoma, Trebuchet MS, Sans-serif;\nfont-size:			11px;\ncolor:				#000;\nbackground-color:	#fff;\n}\n\na {\nfont-family:		Verdana, Arial, Tahoma, Trebuchet MS, Sans-serif;\nfont-weight:		bold;\nletter-spacing:		.09em;\ntext-decoration:	none;\ncolor:			  #330099;\nbackground-color:	transparent;\n}\n\na:visited {\ncolor:				#330099;\nbackground-color:	transparent;\n}\n\na:hover {\ncolor:				#000;\ntext-decoration:	underline;\nbackground-color:	transparent;\n}\n\n#content  {\nborder:				#999999 1px solid;\npadding:			22px 25px 14px 25px;\n}\n\nh1 {\nfont-family:		Verdana, Arial, Tahoma, Trebuchet MS, Sans-serif;\nfont-weight:		bold;\nfont-size:			14px;\ncolor:				#000;\nmargin-top: 		0;\nmargin-bottom:		14px;\n}\n\np {\nfont-family:		Verdana, Arial, Tahoma, Trebuchet MS, Sans-serif;\nfont-size: 			12px;\nfont-weight: 		normal;\nmargin-top: 		12px;\nmargin-bottom: 		14px;\ncolor: 				#000;\n}\n</style>\n\n</head>\n\n<body>\n\n<html><head></head><body>\n<div class=\"input-check-div\"> You will be directed to the Coach Journey site in 5 seconds. If not copy and paste this address in your browser address bar. https://wwwpprd.coachjourney.com </div>\n			<script>\n			$(document).ready(function () {\n				// Handler for .ready() called.\n			window.setTimeout(function () {\n			location.href = \"https://wwwpprd.coachjourney.com\";\n			}, 5000);\n			});\n			</script>\n</body></html>\n\n</body>\n\n</html>', NULL, 1472837450, 1),
(2, 1, 'y', 'message_template', '', 'system', NULL, '<html>\n<head>\n\n<title>{title}</title>\n\n<meta http-equiv=\'content-type\' content=\'text/html; charset={charset}\' />\n\n{meta_refresh}\n\n<style type=\"text/css\">\n\nbody {\nbackground-color:	#ffffff;\nmargin:				50px;\nfont-family:		Verdana, Arial, Tahoma, Trebuchet MS, Sans-serif;\nfont-size:			11px;\ncolor:				#000;\nbackground-color:	#fff;\n}\n\na {\nfont-family:		Verdana, Arial, Tahoma, Trebuchet MS, Sans-serif;\nletter-spacing:		.09em;\ntext-decoration:	none;\ncolor:			  #330099;\nbackground-color:	transparent;\n}\n\na:visited {\ncolor:				#330099;\nbackground-color:	transparent;\n}\n\na:active {\ncolor:				#ccc;\nbackground-color:	transparent;\n}\n\na:hover {\ncolor:				#000;\ntext-decoration:	underline;\nbackground-color:	transparent;\n}\n\n#content  {\nborder:				#000 1px solid;\nbackground-color: 	#DEDFE3;\npadding:			22px 25px 14px 25px;\n}\n\nh1 {\nfont-family:		Verdana, Arial, Tahoma, Trebuchet MS, Sans-serif;\nfont-weight:		bold;\nfont-size:			14px;\ncolor:				#000;\nmargin-top: 		0;\nmargin-bottom:		14px;\n}\n\np {\nfont-family:		Verdana, Arial, Tahoma, Trebuchet MS, Sans-serif;\nfont-size: 			12px;\nfont-weight: 		normal;\nmargin-top: 		12px;\nmargin-bottom: 		14px;\ncolor: 				#000;\n}\n\nul {\nmargin-bottom: 		16px;\n}\n\nli {\nlist-style:			square;\nfont-family:		Verdana, Arial, Tahoma, Trebuchet MS, Sans-serif;\nfont-size: 			12px;\nfont-weight: 		normal;\nmargin-top: 		8px;\nmargin-bottom: 		8px;\ncolor: 				#000;\n}\n\n</style>\n\n</head>\n\n<body>\n\n<div id=\"content\">\n\n<h1>{heading}</h1>\n\n{content}\n\n<p>{link}</p>\n\n</div>\n\n</body>\n\n</html>', NULL, 1460402016, 0),
(3, 1, 'y', 'admin_notify_reg', 'Notification of new member registration', 'email', 'members', 'New member registration site: {site_name}\n\nScreen name: {name}\nUser name: {username}\nEmail: {email}\n\nYour control panel URL: {control_panel_url}', NULL, 1460402016, 0),
(4, 1, 'y', 'admin_notify_entry', 'A new channel entry has been posted', 'email', 'content', 'A new entry has been posted in the following channel:\n{channel_name}\n\nThe title of the entry is:\n{entry_title}\n\nPosted by: {name}\nEmail: {email}\n\nTo read the entry please visit:\n{entry_url}\n', NULL, 1460402016, 0),
(5, 1, 'y', 'admin_notify_comment', 'You have just received a comment', 'email', 'comments', 'You have just received a comment for the following channel:\n{channel_name}\n\nThe title of the entry is:\n{entry_title}\n\nLocated at:\n{comment_url}\n\nPosted by: {name}\nEmail: {email}\nURL: {url}\nLocation: {location}\n\n{comment}', NULL, 1460402016, 0),
(6, 1, 'y', 'mbr_activation_instructions', 'Enclosed is your activation code', 'email', 'members', 'Thank you for your new member registration.\n\nTo activate your new account, please visit the following URL:\n\n{unwrap}{activation_url}{/unwrap}\n\nThank You!\n\n{site_name}\n\n{site_url}', NULL, 1460402016, 0),
(7, 1, 'y', 'forgot_password_instructions', 'Login information', 'email', 'members', '{name},\n\nTo reset your password, please go to the following page:\n\n{reset_url}\n\nThen log in with your username: {username}\n\nIf you do not wish to reset your password, ignore this message. It will expire in 24 hours.\n\n{site_name}\n{site_url}', NULL, 1460402016, 0),
(8, 1, 'y', 'validated_member_notify', 'Your membership account has been activated', 'email', 'members', '{name},\n\nYour membership account has been activated and is ready for use.\n\nThank You!\n\n{site_name}\n{site_url}', NULL, 1460402016, 0),
(9, 1, 'y', 'decline_member_validation', 'Your membership account has been declined', 'email', 'members', '{name},\n\nWe\'re sorry but our staff has decided not to validate your membership.\n\n{site_name}\n{site_url}', NULL, 1460402016, 0),
(10, 1, 'y', 'comment_notification', 'Someone just responded to your comment', 'email', 'comments', '{name_of_commenter} just responded to the entry you subscribed to at:\n{channel_name}\n\nThe title of the entry is:\n{entry_title}\n\nYou can see the comment at the following URL:\n{comment_url}\n\n{comment}\n\nTo stop receiving notifications for this comment, click here:\n{notification_removal_url}', NULL, 1460402016, 0),
(11, 1, 'y', 'comments_opened_notification', 'New comments have been added', 'email', 'comments', 'Responses have been added to the entry you subscribed to at:\n{channel_name}\n\nThe title of the entry is:\n{entry_title}\n\nYou can see the comments at the following URL:\n{comment_url}\n\n{comments}\n{comment}\n{/comments}\n\nTo stop receiving notifications for this entry, click here:\n{notification_removal_url}', NULL, 1460402016, 0),
(12, 1, 'y', 'private_message_notification', 'Someone has sent you a Private Message', 'email', 'private_messages', '\n{recipient_name},\n\n{sender_name} has just sent you a Private Message titled ‘{message_subject}’.\n\nYou can see the Private Message by logging in and viewing your inbox at:\n{site_url}\n\nContent:\n\n{message_content}\n\nTo stop receiving notifications of Private Messages, turn the option off in your Email Settings.\n\n{site_name}\n{site_url}', NULL, 1460402016, 0),
(13, 1, 'y', 'pm_inbox_full', 'Your private message mailbox is full', 'email', 'private_messages', '{recipient_name},\n\n{sender_name} has just attempted to send you a Private Message,\nbut your inbox is full, exceeding the maximum of {pm_storage_limit}.\n\nPlease log in and remove unwanted messages from your inbox at:\n{site_url}', NULL, 1460402016, 0);
