(1, 1, 1, 'index', 'webpage', '{layout=\"layouts/index\"}\r\n    <div class=\"row flex-content full-page-section activestate\" id=\"monthlyFocus\">\r\n        <div class=\"col-lg-12 col-md-12 col-sm-12 col-xs-12 main-data-view\">\r\n            <div class=\"row monthly-focus-content\">\r\n                {embed=\"monthly_focus/index\"}\r\n            </div>\r\n        </div>\r\n    </div>\r\n    <div class=\"row flex-content full-page-section\" id=\"myProfileBlock\">\r\n        <div class=\"col-lg-12 col-md-12 col-sm-12 col-xs-12\">\r\n            <div class=\"row my-profile-content\">\r\n                <div id=\"top\" class=\"profile-overlay\">\r\n					<div class=\"row col-md-12 profile-container\">\r\n						{embed=\"my_profile/index\"}\r\n					</div>\r\n				</div>\r\n            </div>\r\n        </div>\r\n    </div>\r\n\r\n    <div class=\"row flex-content full-page-section\" id=\"mapJourney\">\r\n        <div class=\"journey-content-container\">\r\n            <div class=\"journey-content\">\r\n                {embed=\"journey/index\"}\r\n            </div>\r\n        </div>\r\n        <div id=\"map-preloader\">\r\n            <img src=\"/assets/pdf-preloader.gif\" />\r\n        </div>\r\n    </div>', '', 1504129198, 1, 'n', 0, '1', 'n', 'n', 'o', 0, 'n'),
