(10, 1, 2, '.language_modal_dialog', 'webpage', '<div class=\"modal fade\" id=\"myLanguageModal\" tabindex=\"-1\" role=\"dialog\" aria-labelledby=\"myLanguageModalLabel\" aria-hidden=\"true\">\r\n{embed=\"home/.languages\"}\r\n</div><!-- /.modal -->\r\n<?php\r\n//if($this->EE->input->cookie(\'language_selected\') != \'y\')\r\n//{\r\n?>\r\n<script type=\"text/javascript\">\r\n// <![CDATA[\r\n	// For the Language Modal Popup\r\n	$(\'#myLanguageModal\').on(\'shown.bs.modal\', function (e) {\r\n		$( \"#myLanguageModal button.close\" ).remove();\r\n		$( \"#myLanguageModal button#close\" ).remove();\r\n	});\r\n	\r\n	$( \"#myLanguageModal\" ).modal({\r\n		backdrop: \'static\',\r\n		keyboard: false\r\n	});	\r\n// ]]>\r\n</script>\r\n<?php\r\n//}\r\n?>', '', 1490820059, 1, 'n', 0, '1', 'n', 'y', 'o', 0, 'n'),
(11, 1, 1, '.languages', 'webpage', '<div class=\"modal-dialog\">\r\n    <div class=\"modal-content\">\r\n      <div class=\"modal-header\">\r\n        <button type=\"button\" class=\"close\" data-dismiss=\"modal\" aria-label=\"Close\"><span aria-hidden=\"true\">&times;</span></button>\r\n        <h4 class=\"modal-title\">{exp:transcribe:replace name=\"language_headline\"}</h4>\r\n      </div>\r\n	  <form action=\"{exp:transcribe:action_url}\" method=\"post\">\r\n	  <input type=\"hidden\" name=\"XID\" value=\"{XID_HASH}\">\r\n      <div class=\"modal-body\">\r\n        <div class=\"row\">\r\n			<div class=\"col-md-12\">                                  \r\n				<p>{exp:transcribe:replace name=\"language_intro\"}</p>			\r\n				<div class=\"form-group\">\r\n				<label for=\"language\">{exp:transcribe:replace name=\"language_nav\"}</label>\r\n				{exp:transcribe:language_links}\r\n					<select name=\"lang\" id=\"language\" class=\"form-control\">\r\n					{languages}\r\n					<option value=\"{abbreviation}\"{if current} selected=\"selected\"{/if}>{name}</option>\r\n					{/languages}\r\n					</select>\r\n				{/exp:transcribe:language_links}\r\n				</div>			\r\n			</div>\r\n		</div>\r\n      </div>\r\n      <div class=\"modal-footer\">\r\n	    <button id=\"close\" type=\"button\" class=\"btn btn-default btn-sm herobutton\" data-dismiss=\"modal\">{exp:transcribe:replace name=\"button_close\"}</button>\r\n        <button type=\"submit\" class=\"btn btn-primary btn-sm herobutton\">{exp:transcribe:replace name=\"button_submit\"}</button>        \r\n      </div>\r\n	  </form>\r\n    </div><!-- /.modal-content -->\r\n</div><!-- /.modal-dialog -->\r\n\r\n<script type=\"text/javascript\">\r\n// <![CDATA[\r\n$(function(){\r\n	// For the Site Tracking\r\n	$( \"a.track\" ).unbind( \"click\" );\r\n	$( \"a.track\" ).bind( \"click\", function() {\r\n        sitetracking( this );		\r\n    });\r\n});\r\n// ]]>\r\n</script>', '', 1490820059, 1, 'n', 0, '1', 'n', 'y', 'o', 0, 'n'),
(12, 1, 2, '_global_header', 'webpage', '<!DOCTYPE html>\r\n<!--[if lt IE 7 ]><html class=\"ie ie6\" lang=\"{exp:transcribe:language_abbreviation}\"> <![endif]-->\r\n<!--[if IE 7 ]><html class=\"ie ie7\" lang=\"{exp:transcribe:language_abbreviation}\"> <![endif]-->\r\n<!--[if IE 8 ]><html class=\"ie ie8\" lang=\"{exp:transcribe:language_abbreviation}\"> <![endif]-->\r\n<!--[if (gte IE 9)|!(IE)]><!--><html class=\"not-ie\" lang=\"{exp:transcribe:language_abbreviation}\"> <!--<![endif]-->\r\n\r\n  <head>\r\n    <meta charset=\"utf-8\" />\r\n    <meta http-equiv=\"X-UA-Compatible\" content=\"IE=edge,chrome=1\" />\r\n    <!-- Set viewport. -->\r\n    <meta name=\"viewport\" content=\"width=device-width,initial-scale=1,minimum-scale=1,maximum-scale=1,user-scalable=no,shrink-to-fit=no,minimal-ui\" />\r\n    <title>{site_name}</title>\r\n	<meta name=\"keywords\" content=\"{site_name}\" />\r\n    <meta name=\"description\" content=\"{site_name}\" />\r\n    <meta name=\"robots\" CONTENT=\"noindex, nofollow\" />\r\n    <meta http-equiv=\"Cache-Control\" content=\"no-cache, no-store, must-revalidate\" />\r\n    <meta http-equiv=\"Pragma\" content=\"no-cache\" />\r\n    <meta http-equiv=\"Expires\" content=\"0\" />\r\n\r\n\r\n	\r\n	<!-- CSS  -->\r\n	<link rel=\"icon\" type=\"image/x-icon\" href=\"{site_url}favicon.ico\" />\r\n	<link rel=\"stylesheet\" href=\"{site_url}css/bootstrap.css?v=1\" />\r\n	<link rel=\"stylesheet\" href=\"{site_url}css/jquery-ui.css?v=1\" />\r\n	<link rel=\"stylesheet\" href=\"https://fonts.googleapis.com/css?family=Lato\" type=\"text/css\">\r\n	<link rel=\"stylesheet\" href=\"{site_url}css/jqvmap.css\" media=\"screen\" type=\"text/css\"/>\r\n	<link rel=\"stylesheet\" href=\"{site_url}css/coach.css\" />\r\n	<link rel=\"stylesheet\" href=\"{site_url}css/video-js.css?v=1\" />\r\n	<script type=\"text/javascript\">\r\n	// <![CDATA[\r\n	var coursePopup = false;\r\n    var site_url = \"{site_url}\";\r\n	var logout = (\"{path=\'logout\'}\");\r\n    var site_logout = logout.replace(/&amp;/g , \"&\");\r\n    var site_short_name = \"{site_short_name}\";\r\n	var exp_actions = {exp_actions_json_data};\r\n	var member_profile_data = {\r\n	  elan_user_id: \'<?php echo ee()->input->cookie(\'elan_user_id\'); ?>\',\r\n	  elan_username: \'<?php echo ee()->input->cookie(\'elan_user_name\'); ?>\'\r\n	};\r\n\r\n	{exp:elan_api:get_elan_objects}\r\n	{exp:elan_api:get_elan_tags}\r\n	{exp:elan_api:get_elan_languages}\r\n\r\n	// ]]>\r\n	</script>\r\n\r\n\r\n  <!--         <script src=\"https://use.typekit.net/qkq5wfi.js\"></script>\r\n        <script>try{Typekit.load({ async: true });}catch(e){}</script> -->\r\n<!-- Using Coach Internal Typekit For Testing -->\r\n  <!--<script src=\"https://use.typekit.net/qkq5wfi.js\"></script>-->\r\n  <script src=\"https://use.typekit.net/qen7bex.js\"></script>\r\n  <script>try{Typekit.load({ async: true });}catch(e){}</script>\r\n\r\n	<script src=\"{site_url}js/jquery-2.2.3.min.js\"></script>\r\n	<script src=\"{site_url}js/jquery-ui.min.js\"></script>\r\n	<script src=\"{site_url}js/bootstrap.min.js\"></script>\r\n	<script src=\"{site_url}js/handlebars-runtime-v4.0.5.js\"></script>\r\n    <!-- Temporarily commenting this out, replace \\ with { when added\r\n    <script src=\"{site_url}js/jquery.bpopup.min.js\"></script>\r\n    -->\r\n	<script type=\"text/javascript\" src=\"{site_url}js/jqvmap/1.5.1/jquery.vmap.js\"></script>\r\n\r\n	  {if logged_in}\r\n	<script type=\"text/javascript\" src=\"{site_url}js/raphael-2.1.4.min.js\"></script>\r\n    <script type=\"text/javascript\" src=\"{site_url}js/justgage.js\"></script>\r\n	<script type=\"text/javascript\" src=\"{site_url}js/video.min.js\"></script>\r\n    <script type=\"text/javascript\" src=\"{site_url}js/videojs-contrib-hls.min.js\"></script>\r\n	 {/if}\r\n\r\n	<!-- HTML5 Shim and Respond.js IE8 support of HTML5 elements and media queries -->\r\n	<!--[if lt IE 9]>\r\n			<script type=\"text/javascript\" src=\"{site_url}js/respond.js\"></script>\r\n			<script type=\"text/javascript\" src=\"{site_url}js/html5shiv.js\"></script>\r\n	<![endif]-->\r\n	<!-- <script src=\"{site_url}js/gsap.js\"></script>\r\n	<script src=\"{site_url}js/coach.js\"></script> -->\r\n\r\n  </head>\r\n  <body data-page=\"intro\">\r\n\r\n    <div id=\"not-supported\">\r\n	    <div>\r\n	    	<div class=\"logo\">\r\n	      	<img src=\"{site_url}assets/coach-journey-logo.svg\" />\r\n        </div>\r\n        <div class=\"copy\">\r\n          <h1>WELCOME TO<br>COACH JOURNEY</h1>\r\n          <p>Coach Journey may be accessed on a company desktop or iPad in landscape mode only.</p>\r\n        </div>\r\n	    </div>\r\n    </div>\r\n\r\n	<div class=\"mobile-header\">\r\n		<div id=\"mobile-logo\" class=\"logo\">\r\n			<a href=\"{site_url}\">\r\n				<img src=\"{site_url}assets/coach-journey-logo.svg\" />\r\n			</a>\r\n		</div>\r\n\r\n		<!--<div class=\"translator-icon\">-->\r\n			<!--<img src=\"assets/language-icon.png\" />-->\r\n		<!--</div>-->\r\n		<div class=\"associate-completion\">\r\n			<div class=\"data-circle\">\r\n				<div class=\"circle-line progress\">\r\n					<svg xmlns=\"http://www.w3.org/2000/svg\" version=\"1.1\" viewBox=\"0 0 100 100\">\r\n						<circle cx=\"50\" cy=\"50\" r=\"45\" class=\"data-course-completion-color\" stroke-width=\"8\" fill=\"none\" />\r\n						<g>\r\n							<line x1=\"50\" y1=\"50\" x2=\"50\" y2=\"50\" stroke=\"rgba(255,255,255,1.0) \"class=\"course-circle\" />\r\n							<text x=\"50\" y=\"57\" text-anchor=\"middle\" font-size=\"20\" font-weight=\"600\" class=\"data-assessments-complete\"></text>\r\n						</g>\r\n						<g>\r\n							<circle class=\"progress-assessment-completion-circle\" cx=\"-50\" cy=\"-50\" r=\"48\" stroke-dashoffset=\"\" />\r\n						</g>\r\n					</svg>\r\n				</div>\r\n			</div>\r\n		</div>\r\n\r\n		<div class=\"menu-burger\">\r\n			<i class=\"icon-hamburger-menu\"></i>\r\n		</div>\r\n	</div>\r\n\r\n\r\n  	<div id=\"site-nav\">\r\n\r\n			<a href=\"{site_url}\" class=\"nav-close\">\r\n				<i class=\"icon-close-btn\"></i>\r\n			</a>\r\n\r\n  		<ul>\r\n\r\n  			<li>\r\n  				<a href=\"myProfileBlock\" class=\"coach-nav-link avatar-link\">\r\n  					<!-- Dynamic Avatar From User account goes here -->\r\n						<span class=\"nav-avatar\"></span>\r\n  				</a>\r\n  			</li>\r\n\r\n  			<li class=\"slider-map\">\r\n  				<a href=\"mapJourney\" class=\"coach-nav-link\">\r\n            <i class=\"icon-world-location\"></i>\r\n          </a>\r\n  			</li>\r\n\r\n  		</ul>\r\n  	</div>\r\n    <!-- {if logged_in}{embed=\"home/_language_choice\"}{/if} -->\r\n\r\n', '', 1504129198, 1, 'n', 0, '1', 'n', 'y', 'o', 0, 'n'),
