(14, 1, 4, 'profile', 'webpage', '<!-- <img src=\"{site_url}assets/ambassador-profile-cropped.jpg\" class=\"img-responsive\" /> -->\r\n<script type=\"text/javascript\">\r\n  var journeys = {journeys_json_data};\r\n  {exp:elan_api:lex_categories_data}\r\n</script>\r\n	<div class=\"background-profile-image col-md-12 row\">\r\n\r\n		<div class=\"inner\">\r\n			<!-- Dynamic Avatar From User account goes here -->\r\n			<div class=\"profile-main-image-avatar\">\r\n			</div>\r\n			<div class=\"profile-cover-text\">\r\n				<h4 class=\"assoc-name\"></h4>\r\n				<h5 class=\"assoc-city\"></h5>\r\n				<h5 class=\"assoc-country\"></h5>\r\n			</div>\r\n		</div>\r\n\r\n	</div>\r\n	<div class=\"user-profile row\">\r\n		<div class=\"profile-1 col-md-4\">\r\n			<h5>{exp:transcribe:replace name=\"joined\"}</h5>\r\n			<h4 class=\"joined-coach-date\"></h4>\r\n		</div>\r\n		<div class=\"profile-2 col-md-4\">\r\n			<h5 class=\"associate-role-text\"><span class=\"associate-role\"></span> {exp:transcribe:replace name=\"since\"}</h5>\r\n            <h4 class=\"associate-date\"></h4>\r\n\r\n		</div>\r\n		<div class=\"profile-3 col-md-4\">\r\n			<h5 class=\"assoc-rank-text\"><span class=\"assoc-rank\"></span> {exp:transcribe:replace name=\"since\"}</h5>\r\n            <h4 class=\"assoc-rank-date\"></h4>\r\n		</div>\r\n	</div>\r\n	<div class=\"row bottom-profile\">\r\n		<div class=\"progress-score-row\">\r\n			<div class=\"vertical-center data-circle myprofile-row-2-1\">\r\n				<div class=\"circle-line progress\">\r\n					<svg xmlns=\"http://www.w3.org/2000/svg\" version=\"1.1\" viewBox=\"0 0 100 100\">\r\n						<circle cx=\"50\" cy=\"50\" r=\"40\" stroke-width=\"8\" fill=\"none\" class=\"data-assessment-completion-color\" />\r\n						<g>\r\n							<line x1=\"50\" y1=\"50\" x2=\"50\" y2=\"50\" stroke=\"rgba(235,235,235,1.0)\" class=\"course-circle\" />\r\n							<text x=\"50\" y=\"59\" text-anchor=\"middle\" font-size=\"16\" font-weight=\"600\" class=\"data-assessments-complete\"></text>\r\n						</g>\r\n						<g>\r\n							<circle class=\"progress-profile-assessment-completion-circle\" cx=\"-50\" cy=\"-50\" r=\"45\" stroke-dashoffset=\"\" />\r\n						</g>\r\n					</svg>\r\n					<h5>{exp:transcribe:replace name=\"monthly\"}<br>{exp:transcribe:replace name=\"completion\"}</h5>\r\n				</div>\r\n			</div>\r\n			<div class=\"vertical-center myprofile-row-2-2\">\r\n                    <div class=\"clear\">\r\n						<div id=\"g2\" class=\"gauge\"><h4 class=\"assoc-rank-next assoc-rank-text\"></h4></div>\r\n						<h5>{exp:transcribe:replace name=\"nextprofile\"}</br>{exp:transcribe:replace name=\"level\"}</h5>\r\n					</div>\r\n					\r\n			</div>\r\n			<div class=\"vertical-center data-circle myprofile-row-2-3\">\r\n				<div class=\"circle-line progress\">\r\n					<svg xmlns=\"http://www.w3.org/2000/svg\" version=\"1.1\" viewBox=\"0 0 100 100\">\r\n						<circle cx=\"50\" cy=\"50\" r=\"40\" stroke-width=\"8\" fill=\"none\" class=\"data-assessment-average-color\"/>\r\n						<g>\r\n							<line x1=\"50\" y1=\"50\" x2=\"50\" y2=\"50\" stroke=\"rgba(235,235,235,1.0)\" class=\"course-circle\" />\r\n							<text x=\"52\" y=\"59\" text-anchor=\"middle\" font-size=\"16\" font-weight=\"600\" class=\"data-assessments-percent\"></text>\r\n\r\n							<!-- <text x=\"50\" y=\"115\" text-anchor=\"middle\" font-size=\"12\">MONTHLY</text> \r\n							<text x=\"50\" y=\"130\" text-anchor=\"middle\" font-size=\"12\">AVR SCORE</text> -->\r\n						</g>\r\n						<g>\r\n							<circle class=\"progress-assessment-average-circle\" cx=\"-50\" cy=\"-50\" r=\"45\" stroke-dashoffset=\"\" />\r\n						</g>\r\n					</svg>\r\n					<h5>{exp:transcribe:replace name=\"monthly\"}<br>{exp:transcribe:replace name=\"avgscore\"}</h5>\r\n				</div>\r\n			</div>\r\n		</div>\r\n	<div class=\"profile-main-row-2 clearfix\">\r\n		<hr class=\"profile-row-3\" />\r\n		<div class=\"myprofile-row-3-1\">\r\n			<h3> {exp:transcribe:replace name=\"next\"}<br>{exp:transcribe:replace name=\"destination\"} </h3>\r\n			<