('', '', '', 1, 'May, 25 2017 17:28:03', 0, 8, '', 'Success Track', '<p>Meet the key silhouettes in the Coach 1941 Pre Fall collection, a celebration of wanderlust that includes the most captivating of frontiers, outer space. </p>', 'Active', ' 3783, 3784, 3785, 3786, 3787, 3772', 0, 'https://coach.ttnlearning.com/content/objects/3762/juneproductfocus1thumbnail.jpg', 3762, 'Coach 1941 Pre Fall', 0, 1, 0, '', 0, ' PRODUCT FOCUS, Item 1, Monthly Focus Main, Row 1, English, June, 2017', 0, '', '', '', '', '', '', '', '', '', '', 'Mar, 23 2018 22:54:26'),
('', '', '', 1, 'May, 25 2017 17:36:09', 0, 8, '', 'Success Track', '<p>Meet the key statements and silhouettes in this season\'s Coach New York Women\'s Collection, plus learn everything there is to know about our new favorite, the Bandit Hobo. </p>', 'Active', ' 3788, 3789, 3790, 3791, 3773', 0, 'https://coach.ttnlearning.com/content/objects/3763/productfocus2junethumbnail.jpg', 3763, 'Coach NEW YORK Women', 0, 1, 0, '', 0, ' PRODUCT FOCUS, Monthly Focus Main, Row 1, Item 2, English, June, 2017', 0, '', '', '', '', '', '', '', '', '', '', 'Mar, 23 2018 22:54:26'),
('', '', '', 1, 'May, 25 2017 17:42:45', 0, 8, '', 'Success Track', '<p>Meet the key statements and silhouettes in this season\'s Coach New York Men\'s Collection, plus refresh your knowledge of our men\'s belts—including how to cut them to size for customers. </p>', 'Active', ' 3792, 3793, 3794, 3795, 3796, 3774', 0, 'https://coach.ttnlearning.com/content/objects/3764/productfocus3june.jpg', 3764, 'Coach NEW YORK MEN ', 0, 1, 0, '', 0, ' PRODUCT FOCUS, Monthly Focus Main, Row 1, Item 3, English, June, 2017', 0, '', '', '', '', '', '', '', '', '', '', 'Mar, 23 2018 22:54:26'),
('', '', '', 1, 'May, 25 2017 17:51:21', 0, 8, '', 'Success Track', '<p>Learn tips and techniques for styling your customers in key pieces from the Coach 1941 Pre Fall collection. </p>', 'Active', ' 3797, 3838, 3775', 0, 'https://coach.ttnlearning.com/content/objects/3765/service1thumbnailjune.jpg', 3765, 'STYLING 101', 0, 1, 0, '', 0, ' SERVICE FOCUS, Item 1, Monthly Focus Main, Row 2, English, June, 2017', 0, '', '', '', '', '', '', '', '', '', '', 'Mar, 23 2018 22:54:26'),
('', '', '', 1, 'May, 25 2017 17:56:53', 0, 8, '', 'Success Track', '<p>Take a short course on the basics of visual merchandising—a combination of \"magic\" and \"logic.\" To learn more, visit the Chinatown neighborhood now available on Coach Journey—on the fundamentals of VM. </p>', 'Active', ' 3798, 3799, 3776', 0, 'https://coach.ttnlearning.com/content/objects/3766/servicetilejune.jpg', 3766, 'VISUAL MERCHANDISING', 0, 1, 0, '', 0, ' SERVICE FOCUS, Monthly Focus Main, Item 2, Row 2, English, June, 2017', 0, '', '', '', '', '', '', '', '', '', '', 'Mar, 23 2018 22:54:26'),
('', '', '', 1, 'May, 25 2017 18:18:31', 0, 8, '', 'Success Track', '<p>Refresh your management skills with this reference guide and tips for coaching on Fashion and Styling </p>', 'Active', ' 3801, 3802', 0, 'https://coach.ttnlearning.com/content/objects/3768/managerfocus.jpg', 3768, 'MANAGER FOCUS', 0, 1, 0, '', 0, ' RETAIL, OUTLET, Monthly Focus Main, Item 2, Row 3, English, June, 2017, MANAGER FOCUS', 0, '', '', '', '', '', '', '', '', '', '', 'Mar, 23 2018 22:54:26');
