('', '', '', 1, 'September, 22 2017 18:33:59', 0, 1, ' 9', 'Course', '<p>Founded in 1941, Coach is the original American House of Leather. From humble beginnings as a small, family-run workshop offering quality craftsmanship to our current position as a global lifestyle brand redefining luxury for the modern age, our story ', 'Active', ' 5700, 5695, 117, 5697, 5698, 5699, 4451, 5701', 0, 'https://coach.ttnlearning.com/content/objects/5690/MLDay2.jpg', 5690, 'Day 2: Brand & Modern Luxury', 0, 1, 0, '', 0, ' English, ML TRAINEE, Day 2, Permanent Full Time', 0, '', '', '', '', '', '', '', '', '', '', 'Mar, 23 2018 22:54:26'),
('', '', '', 1, 'September, 22 2017 18:36:17', 0, 1, ' 11', 'Course', '<p>In the 1960s, Coach handbags revolutionized the industry with their pure form, functional design and rich, colorful leathers. Today, Creative Director Stuart Vevers celebrates Coach heritage within his singular vision of American cool—modernizing the b', 'Active', ' 5700, 5687, 5705, 5706, 5697, 5707, 5708, 5726, 4451, 5702', 0, 'https://coach.ttnlearning.com/content/objects/5691/MLDay3.jpg', 5691, 'Day 3: Product', 0, 1, 0, '', 0, ' English, ML TRAINEE, Day 3, Permanent Full Time', 0, '', '', '', '', '', '', '', '', '', '', 'Mar, 23 2018 22:54:26'),
('', '', '', 1, 'September, 22 2017 18:37:32', 0, 1, '', 'Course', '<p>From stock organization to POS training to customer service policies and procedures, a Modern Luxury customer experience requires smooth and seamless store operations. </p> \n<p>Today, on the final day of your first week at Coach, you will learn about t', 'Active', ' 5709, 5687, 5710, 5711, 5712, 5697, 5713, 5714, 5715, 5703', 0, 'https://coach.ttnlearning.com/content/objects/5692/MLDay5.jpg', 5692, 'Day 5: Operations', 0, 1, 0, '', 0, ' English, ML TRAINEE, Day 4, Permanent Full Time', 0, '', '', '', '', '', '', '', '', '', '', 'Mar, 23 2018 22:54:26'),
('', '', '', 1, 'September, 22 2017 18:38:43', 0, 1, '', 'Course', '<p>With over 75 years of heritage as the Original American House of Leather, Coach’s legacy of leather craft is authentic and unique. </p> \n<p>Today, you will learn about the leather craftsmanship and leather care services that distinguish Coach. You will', 'Active', ' 5718, 5687, 5727, 5719, 5720, 5697, 5724, 5721, 5722, 4451, 5704', 0, 'https://coach.ttnlearning.com/content/objects/5693/MLDay4.jpg', 5693, 'Day 4: Leather & Clienteling', 0, 1, 0, '', 0, ' English, ML TRAINEE, Day 5, Permanent Full Time', 0, '', '', '', '', '', '', '', '', '', '', 'Mar, 23 2018 22:54:26'),
