('', '', '', 1, 'October, 02 2017 02:55:15', 0, 1, '', 'Course', '<p>In Week 2 of your Trainee onboarding, your focus is on practicing your skills on the floor, with customers. Throughout the week, ask questions to your manager and colleagues, review Coach Journey Monthly Focus and review last week modules as needed—to ', 'Active', '', 0, 'https://coach.ttnlearning.com/content/objects/5869/MLweek2Overview.jpg', 5869, 'Week 2 Overview', 0, 1, 0, '', 0, ' English, ML TRAINEE, Permanent Full Time, Week 2', 0, '', '', '', '', '', '', '', '', '', '', 'Mar, 23 2018 22:54:26'),
('', '', '', 1, 'October, 02 2017 02:58:45', 0, 1, '', 'Course', '<p>As you engage customers, practice the Modern Luxury hosting skills you learned last week. You will also learn about ML Etiquette and the Power of Three—critical to making customers feel welcome and at ease in your store.  </p>', 'Active', '', 0, 'https://coach.ttnlearning.com/content/objects/5870/MLweek26R.jpg', 5870, 'Day 6: Hosting (R)', 0, 1, 0, '', 0, ' English, ML TRAINEE, Day 6, Permanent Full Time, Week 2', 0, '', '', '', '', '', '', '', '', '', '', 'Mar, 23 2018 22:54:26'),
('', '', '', 1, 'October, 02 2017 03:04:59', 0, 1, '', 'Course', '<p>Today, the focus is on engaging customers on Coach leather and leather services. You will also learn about Coach repair services—a critical opportunity to build the loyalty of our customers. </p>', 'Active', ' 2324, 5934, 5727', 0, 'https://coach.ttnlearning.com/content/objects/5871/MLweek27R8O.jpg', 5871, 'Day 7: Leather Services (R)', 0, 1, 0, '', 0, ' English, ML TRAINEE, Day 6, Permanent Full Time, Week 2', 0, '', '', '', '', '', '', '', '', '', '', 'Mar, 23 2018 22:54:26'),
('', '', '', 1, 'October, 02 2017 03:05:31', 0, 1, '', 'Course', '<p>Today you will learn about Coach Create, an exciting personalization experience available in all retail stores. A colleague will walk you through your store\'s specific offering. </p>', 'Active', '', 0, 'https://coach.ttnlearning.com/content/objects/5872/MLweek28R.jpg', 5872, 'Day 8: Coach Create (R)', 0, 1, 0, '', 0, ' English, ML TRAINEE, Day 6, Permanent Full Time, Week 2', 0, '', '', '', '', '', '', '', '', '', '', 'Mar, 23 2018 22:54:26'),
('', '', '', 1, 'October, 02 2017 03:05:50', 0, 1, '', 'Course', '<p>As you help customers, focus on getting to know them and planting the seed for your follow up. Your e-learning will give you a deeper understanding of clienteling expectations and tools. </p>', 'Active', '', 0, 'https://coach.ttnlearning.com/content/objects/5873/MLweek29R.jpg', 5873, 'Day 9: Clienteling (R)', 0, 1, 0, '', 0, ' English, ML TRAINEE, Day 6, Permanent Full Time, Week 2', 0, '', '', '', '', '', '', '', '', '', '', 'Mar, 23 2018 22:54:26'),
('', '', '', 1, 'October, 02 2017 03:06:08', 0, 1, '', 'Course', '<p>Congratulations, you\'ve reached the last day of your ML Trainee onboarding. At the end of the day, you will take the ML Trainee Assessment. Once you pass the assessment, you will become a ML Trainee and embark on your NYC journey. </p>', 'Active', '', 0, 'https://coach.ttnlearning.com/content/objects/5874/MLweek210.jpg', 5874, 'Day 10: Recap and Review', 0, 1, 0, '', 0, ' English, ML TRAINEE, Day 6, Permanent Full Time, Week 2', 0, '', '', '', '', '', '', '', '', '', '', 'Mar, 23 2018 22:54:26'),
('', '', '', 1, 'October, 02 2017 16:53:13', 0, 1, ' 10', 'Course', '<p>Welcome to Coach! As a member of our store team, you play a critical role as a brand ambassador who brings the Coach Modern Luxury experience to life for customers—and creates lasting impressions of the brand. </p> \n<p>Over the course of the next week,', 'Active', ' 5988, 5989, 5991, 5992, 5993, 117, 5994, 5995', 0, 'https://coach.ttnlearning.com/content/objects/5876/MLDay1.jpg', 5876, 'Day 1: Company (Seasonal)', 0, 1, 0, '', 0, ' English, ML TRAINEE, Day 1, Seasonal', 0, '', '', '', '', '', '', '', '', '', '', 'Mar, 23 2018 22:54:26'),
('', '', '', 1, 'October, 02 2017 16:56:41', 0, 1, '', 'Course', '<p>Founded in 1941, Coach is the original American House of Leather. From humble beginnings as a small, family-run workshop offering quality craftsmanship to our current position as a global lifestyle brand redefining luxury for the modern age, our story ', 'Active', '', 0, 'https://coach.ttnlearning.com/content/objects/5878/MLDay2.jpg', 5878, 'Day 2: Brand and Modern Luxury (Seasonal) ', 0, 1, 0, '', 0, ' English, ML TRAINEE, Day 2, Seasonal', 0, '', '', '', '', '', '', '', '', '', '', 'Mar, 23 2018 22:54:26'),
('', '', '', 1, 'October, 02 2017 16:57:21', 0, 1, '', 'Course', '<p>In the 1960s, Coach handbags revolutionized the industry with their pure form, functional design and rich, colorful leathers. Today, Creative Director Stuart Vevers celebrates Coach heritage within his singular vision of American cool—modernizing the b', 'Active', ' 5700', 0, 'https://coach.ttnlearning.com/content/objects/5879/MLDay3.jpg', 5879, 'Day 3: Product (Seasonal)', 0, 1, 0, '', 0, ' English, ML TRAINEE, Day 3, Seasonal', 0, '', '', '', '', '', '', '', '', '', '', 'Mar, 23 2018 22:54:26'),
('', '', '', 1, 'October, 02 2017 16:58:18', 0, 1, '', 'Course', '<p>With over 75 years of heritage as the Original American House of Leather, Coach’s legacy of leather craft is authentic and unique. </p> \n<p>Today, you will learn about the leather craftsmanship and leather care services that distinguish Coach. </p>', 'Active', '', 0, 'https://coach.ttnlearning.com/content/objects/5880/MLDay4.jpg', 5880, 'Day 4: Leather and Services (Seasonal)', 0, 1, 0, '', 0, ' English, ML TRAINEE, Day 4, Seasonal', 0, '', '', '', '', '', '', '', '', '', '', 'Mar, 23 2018 22:54:26'),
('', '', '', 1, 'October, 02 2017 16:59:17', 0, 1, '', 'Course', '<p>Today, on the final day of your onboading, you will learn the specific skills you will need in your seasonal role, e.g., greeter, cashier or stock support. You will also spend some time shadowing a colleague in your designated role. </p>', 'Active', '', 0, 'https://coach.ttnlearning.com/content/objects/5881/MLDay5.jpg', 5881, 'Day 5: Your Role (Seasonal)', 0, 1, 0, '', 0, ' English, ML TRAINEE, Day 5, Seasonal', 0, '', '', '', '', '', '', '', '', '', '', 'Mar, 23 2018 22:54:26'),
