('', '', '', 2, 'October, 17 2017 14:00:50', 0, 9, '', 'Curriculum', '<p>Founded in 1941, Coach is the original American House of Leather. From humble beginnings as a small, family-run workshop offering quality craftsmanship to our current position as a global lifestyle brand redefining luxury for the modern age, our story ', 'Active', ' 5694, 5687, 5698, 5697, 6533, 118, 6010, 6982, 6012', 0, 'https://coach.ttnlearning.com/content/objects/5968/MLDay2.jpg', 5968, 'Day 2: Modern Luxury', 0, 1, 0, '', 0, ' English, ML TRAINEE, Day 2, Permanent Full Time', 0, '', '', '', '', '', '', '', '', '', '', 'Mar, 23 2018 22:54:26'),
('', '', '', 1, 'October, 17 2017 14:08:29', 0, 1, ' 1', 'Course', '', 'Active', '', 0, '', 5969, 'Day 2 Video', 0, 1, 0, '00:15:00', 0, ' English, ML TRAINEE', 0, '', '', '', '', '', '', '', '', '', '', 'Mar, 23 2018 22:54:26'),
('', '', '', 1, 'October, 17 2017 14:37:26', 0, 9, '', 'Curriculum', '<p>In the 1960s, Coach handbags revolutionized the industry with their pure form, functional design and rich, colorful leathers. Today, Creative Director Stuart Vevers celebrates Coach heritage within his singular vision of American cool—modernizing the b', 'Active', ' 5700, 5687, 119, 6638, 6498, 5697, 6499, 5708, 6983, 6018', 0, 'https://coach.ttnlearning.com/content/objects/5970/MLDay3.jpg', 5970, 'Day 3: Product', 0, 1, 0, '', 0, ' English, ML TRAINEE, Day 3, Permanent Full Time', 0, '', '', '', '', '', '', '', '', '', '', 'Mar, 23 2018 22:54:26'),
('', '', '', 1, 'October, 17 2017 14:42:48', 0, 1, ' 1', 'Course', '', 'Active', '', 0, '', 5971, 'Day 3 Video', 0, 1, 0, '00:15:00', 0, ' English, ML TRAINEE', 0, '', '', '', '', '', '', '', '', '', '', 'Mar, 23 2018 22:54:26'),
('', '', '', 1, 'October, 17 2017 15:01:26', 0, 9, '', 'Curriculum', '<p>With over 75 years of heritage as the Original American House of Leather, Coach’s legacy of leather craft is authentic and unique. </p> \n<p>Today, you will learn about the leather craftsmanship and leather care services that distinguish Coach. You will', 'Active', ' 5709, 5687, 5727, 5719, 5720, 6500, 5697, 5724, 5721, 5722, 6984, 5703', 0, 'https://coach.ttnlearning.com/content/objects/5972/MLDay4.jpg', 5972, 'Day 4: Leather & Clienteling', 0, 1, 0, '', 0, ' English, ML TRAINEE, Day 4, Permanent Full Time', 0, '', '', '', '', '', '', '', '', '', '', 'Mar, 23 2018 22:54:26'),
('', '', '', 1, 'October, 17 2017 15:15:54', 0, 9, '', 'Curriculum', '<p>From stock organization to POS training to customer service policies and procedures, a Modern Luxury customer experience requires smooth and seamless store operations. </p> \n<p>Today, on the final day of your first week at Coach, you will learn about t', 'Active', ' 5718, 5687, 5710, 5711, 5712, 6538, 5697, 5713, 5714, 5715, 6801, 6985, 5704, 6539', 0, 'https://coach.ttnlearning.com/content/objects/5973/MLDay5.jpg', 5973, 'Day 5: Operations', 0, 1, 0, '', 0, ' English, ML TRAINEE, Day 5, Permanent Full Time', 0, '', '', '', '', '', '', '', '', '', '', 'Mar, 23 2018 22:54:26'),
('', '', '', 2, 'October, 24 2017 18:23:59', 0, 8, '', 'Success Track', '<p>Get to know the Coach 1941 Pre-Spring collection—an exploration of rock royalty and disco gloss—and meet key silhouettes like the new Cooper Carryall. </p>', 'Active', ' 5982, 5983, 5984, 5985, 5986, 6019', 0, 'https://coach.ttnlearning.com/content/objects/5974/productfocus1november.jpg', 5974, 'Coach 1941 Pre-Spring 2018', 0, 1, 0, '', 0, ' RETAIL, PRODUCT FOCUS, Item 1, Monthly Focus Main, Row 1, English, November, January, 2017, French, 2018', 0, '', '', '', '', '', '', '', '', '', '', 'Mar, 23 2018 22:54:26'),
('', '', '', 2, 'October, 24 2017 18:32:05', 0, 8, '', 'Success Track', '<p>Explore the key themes of the Coach New York holiday collection for women—from Americana florals to cool metallics to luxe quilting styles. Even better: Meet our new Coach Mascots, which are a key part of our gifting collection. </p>', 'Active', ' 5998, 5999, 6000, 6020', 0, 'https://coach.ttnlearning.com/content/objects/5975/productfocus2november.jpg', 5975, 'Holiday 2017: Women\'s', 0, 1, 0, '', 0, ' RETAIL, PRODUCT FOCUS, Monthly Focus Main, Row 1, Item 2, English, November, January, 2017, French, 2018', 0, '', '', '', '', '', '', '', '', '', '', 'Mar, 23 2018 22:54:26'),
('', '', '', 2, 'October, 24 2017 18:38:08', 0, 8, '', 'Success Track', '<p>Explore the key themes of the Coach New York holiday collection for men—from classic Signature Crossgrain to fashion-forward styles like Wild Beast Leather and Coach Link. </p>', 'Active', ' 6001, 6002, 6003, 6004, 6021', 0, 'https://coach.ttnlearning.com/content/objects/5976/productfocus3november.jpg', 5976, 'Holiday 2017: Men\'s', 0, 1, 0, '', 0, ' RETAIL, PRODUCT FOCUS, Monthly Focus Main, Row 1, Item 3, English, November, January, 2017, French, 2018', 0, '', '', '', '', '', '', '', '', '', '', 'Mar, 23 2018 22:54:26'),
('', '', '', 2, 'October, 24 2017 18:41:16', 0, 8, '', 'Success Track', '<p>Review key tips for engaging customers during the holiday season—from hosting multiple customers at once to proposing the perfect gift to closing the sale. </p>', 'Active', ' 6023, 6024, 6025, 6026, 6062', 0, 'https://coach.ttnlearning.com/content/objects/5977/service1thumbnailnovember2.jpg', 5977, 'Engaging the Holiday Shopper ', 0, 1, 0, '', 0, ' RETAIL, SERVICE FOCUS, Item 1, Monthly Focus Main, Row 2, English, November, January, 2017, French, 2018', 0, '', '', '', '', '', '', '', '', '', '', 'Mar, 23 2018 22:54:26'),
('', '', '', 2, 'October, 24 2017 18:44:59', 0, 8, '', 'Success Track', '<p>Review key tips for clienteling around the gifting season—including hosting holiday appointments as well as customer information capture dos and don\'ts. Bonus: Find out the new leather services available for holiday. </p>', 'Active', ' 6027, 6028, 6072, 6029', 0, 'https://coach.ttnlearning.com/content/objects/5978/service2thumbnailnovember.jpg', 5978, 'Holiday Clienteling & Services ', 0, 1, 0, '', 0, ' RETAIL, SERVICE FOCUS, Monthly Focus Main, Item 2, Row 2, English, November, January, 2017, French, 2018', 0, '', '', '', '', '', '', '', '', '', '', 'Mar, 23 2018 22:54:26'),
('', '', '', 2, 'October, 24 2017 19:01:11', 0, 8, '', 'Success Track', '<p>Learn how you can create a personalized gifting experience for your customer through Coach Create offerings and key styling principles. </p>', 'Active', ' 6190, 6030, 6031, 6032, 6033, 6063', 0, 'https://coach.ttnlearning.com/content/objects/5979/seasonalfocusnovemberthumbnail.jpg', 5979, 'Holiday 2017 Gifting', 0, 1, 0, '', 0, ' SEASONAL FOCUS, Item 1, Monthly Focus Main, Row 3, English, November, January, 2017, French, 2018', 0, '', '', '', '', '', '', '', '', '', '', 'Mar, 23 2018 22:54:26'),
('', '', '', 2, 'October, 24 2017 20:23:42', 0, 8, '', 'Success Track', '<p>Refresh your core selling skills by reviewing topics from last month\'s services focus. </p>', 'Active', ' 5758, 5759, 6034, 6035, 6036, 5769', 0, 'https://coach.ttnlearning.com/content/objects/5980/productfocus1coachcreate1.jpg', 5980, 'ARCHIVE ', 0, 1, 0, '', 0, ' RETAIL, LAST MONTH ARCHIVE, Monthly Focus Main, Item 2, Row 4, English, February, March, French, 2018', 0, '', '', '', '', '', '', '', '', '', '', 'Mar, 23 2018 22:54:26');
