(591, 'The ML Apprentice level will take you through six NYC areas, each composed of multiple neighborhoods. ', 119),
(592, '现代奢华学徒阶段将带您游览纽约市的六个区域，其中每个区域包含多个街区。', 119),
(593, '現代時尚奢華學徒階段將帶領您遊覽紐約市六大區域， 各區域中皆有數個街區。', 119),
(594, 'モダンラグジュアリー実習生のレベルでは、NYCの6つのエリアをご案内します。各エリアは複数の地区からなります。', 119),
(595, '모던 럭셔리 어프렌티스 레벨은 각각 다수의 타운으로 이루어진 뉴욕 시에 위치한 총 6개 지역으로 여러분을 안내할 것입니다.', 119),
(596, 'Click on the map to view an area. Click “ENTER NEIGHBORHOODS” to view the neighborhoods in that area. Click the “NEXT” and “PREVIOUS” buttons to move between neighborhoods within an area.', 120),
(597, '点击地图查看特定区域。点击“进入街区”查看该区域的街区。点击“下一页”和“上一页”可在同一区域的各个街区之间切换。', 120),
(598, '點選地圖檢視特定區域。點選「進入街區」檢視本區域中的街區。點選「下一頁」或「上一頁」按鈕，在同樣區域中的街區間切換。', 120),
(599, 'エリアを見るには、マップ上で見たいエリアをクリックしてください。「地区に入る」をクリックすると、そのエリアの地区が表示されます。エリア内の地区を前後に移動するには、「次へ」と「戻る」の各ボタンをクリックします。', 120),
(600, '지역을 보시려면 이 지도를 클릭해주세요. 해당 지역에 위치한 타운을 보시려면 \'타운 방문하기\' 버튼을 클릭해주세요. 해당 지역 내에 있는 타운 사이를 이동하시려면 \'다음\'과 \'이전\' 버튼을 클릭해주세요.', 120),
(601, 'Each neighborhood is a course. Click “EXPERIENCE” to enter the neighborhood and start the course. You may complete a course all at once, or save your progress and return at a later time. ', 121),
(602, '每个街区都包含一个课程。点击“体验”进入街区，并开始学习课程。您可以一次性完成课程，也可以保存进度，下次再返回学习。', 121),
(603, '每個街區都是一堂課程。點選「體驗」進入該街區並開始課程。您可以一次完成所有課程，或者儲存進度並稍後回來繼續學習。', 121),
(604, '各地区が1つのコースになっています。「体験する」をクリックして地区に入り、コースを開始しましょう。すべてのコースを一度に最後まで学習することも、進んだところまで一時保存し、後日その場所から学習を続けることもできます。', 121),
(605, '각 타운은 하나의 코스입니다. 타운에 들어가시려면 \'경험하기\' 버튼을 클릭하셔서 코스를 시작해주세요. 코스를 한 번에 다 완료하실 수도 있고, 진행 상황을 저장했다가 추후에 다시 되돌아올 수도 있습니다.', 121),
(606, 'At the end of each course, you will take a final assessment—both online and offline. Successful completion certifies you to continue your journey.', 122),
(607, '在每个课程结束时，您将接受最终评估——包括线上和线下两部分。顺利完成之后您将可继续自己的旅程。', 122),
(608, '在每個課程結束時，您必須線上及線下進行最終評估。順利完成評估則可以繼續您的旅程。', 122),
(609, '各コースの終わりに、最終テストを受けていただきます。テストはオンラインとオフラインの両方で行います。テストに合格すると、続きのジャーニーを続けられます。', 122),
(610, '각 코스의 마지막에, 여러분은 온라인과 오프라인 모두에서 최종 평가를 치르게 됩니다. 최종 평가를 성공적으로 마치면 여정을 계속 하실 수 있는 수료증을 드립니다.', 122),
